CLASS_MAGE_FEMALE = "Mages are the iconic magic-users of Azeroth and learn their craft through intense research and study. They make up for their light armor with a potent array of offensive and defensive spells. Their primary stat is Intellect.";
CLASS_MONK = "The ancient monks of Pandaria developed their martial arts as a way of rebelling against their former overlords. Now the rediscovered Pandaren have begun to spread their monastic teachings to the other races of Azeroth. Monks are known for their skill in hand to hand fighting, relying on their fists and feet as much as their weapons. Healing monks are proficient in traditional medicine and often become spiritual leaders in their communities. Monk primary stats depend on their role: Agility for tanks and melee fighters and Intellect for healers.";
CLASS_PALADIN = "Paladins are heavily-armored fighters and defenders who use Holy magic to heal wounds and combat evil. Paladins are relatively self-sufficient and have many abilities targeted at death prevention. They can focus on two-handed weapons, shields or healing. Their primary stats depend on their role.";
CLASS_PALADIN_FEMALE = "Paladins are heavily-armored fighters and defenders who use Holy magic to heal wounds and combat evil. Paladins are relatively self-sufficient and have many abilities targeted at death prevention. They can focus on two-handed weapons, shields or healing. Their primary stats depend on their role.";
CLASS_PRIEST = "Priests are well-rounded healers with a variety of tools. However, they can also sacrifice their healing to deal damage with Shadow magic. Within society, priests act as the spiritual leaders of their respective races. The priest's primary stats are Intellect, and Spirit if healing.";
CLASS_PRIEST_FEMALE = "Priests are well-rounded healers with a variety of tools. However, they can also sacrifice their healing to deal damage with Shadow magic. Within society, priests act as the spiritual leaders of their respective races. The priest's primary stats are Intellect, and Spirit if healing.";
CLASS_ROGUE = "Rogues often serve as assassins or scouts, though many are lone wolves as well. Rogues specialize in dual-wielding a variety of weapons, though the iconic rogue weapon is the dagger.|n|nRogues can often sneak around enemies or attack an opponent from behind to try and finish them off quickly. Their primary stat is Agility.";
CLASS_ROGUE_FEMALE = "Rogues often serve as assassins or scouts, though many are lone wolves as well. Rogues specialize in dual-wielding a variety of weapons, though the iconic rogue weapon is the dagger.|n|nRogues can often sneak around enemies or attack an opponent from behind to try and finish them off quickly. Their primary stat is Agility.";
CLASS_SHAMAN = "Shaman use the power of the elements to enhance their weapon damage or spells. Shaman summon totems in combat, small objects that buff, heal or cause damage to enemies. Shaman often act as spiritual leaders in tribal communities. Their primary stats depend on their role.";
CLASS_SHAMAN_FEMALE = "Shaman use the power of the elements to enhance their weapon damage or spells. Shaman summon totems in combat, small objects that buff, heal or cause damage to enemies. Shaman often act as spiritual leaders in tribal communities. Their primary stats depend on their role.";
CLASS_WARLOCK = "Warlocks deal Fire or Shadow magic to damage, drain or curse their enemy. They summon demons as servants. Warlocks can convert their health into mana or summon group members to their locations.\n\nWarlocks are feared in some Alliance societies while considered great leaders in some Horde societies. As casters, the warlock's primary stat is Intellect.";
CLASS_WARLOCK_FEMALE = "Warlocks deal Fire or Shadow magic to damage, drain or curse their enemy. They summon demons as servants. Warlocks can convert their health into mana or summon group members to their locations.\n\nWarlocks are feared in some Alliance societies while considered great leaders in some Horde societies. As casters, the warlock's primary stat is Intellect.";
CLASS_WARRIOR = "Warriors are plate-wearing fighters who strive for perfection in armed combat. As warriors deal damage, they generate rage, which is used to power special attacks.\n\nWarriors can choose to focus on a two-handed weapon, dual-wielding or using a sword and shield. Warriors have several abilities that let them move quickly around the battlefield. Their primary stat is Strength, though tanking warriors desire Stamina as well.";
CLASS_WARRIOR_FEMALE = "Warriors are plate-wearing fighters who strive for perfection in armed combat. As warriors deal damage, they generate rage, which is used to power special attacks.\n Warriors can choose to focus on a two-handed weapon, dual-wielding or using a sword and shield. Warriors have several abilities that let them move quickly around the battlefield. Their primary stat is Strength, though tanking warriors desire Stamina as well.";
